Het verhaal over een fictionele wereld waarin onze Aarde in het jaar 1982 door buitenaards leven wordt gevonden. De mensheid heeft dit buitenaardse ras echter als tweederangsburgers ondergebracht in getto's in Zuid-Afrika. Ze krijgen steun van een overheidsfunctionaris wanneer deze hun biotechnologie ontdekt.
